import React from "react";
import TextField from '@material-ui/core/TextField';

const inputData = () => {

}

const ToDoList= () => {
    return(
        <>
            <div className = "center_div">
            <h1>ToDo List</h1>
            <TextField id="outlined-basic" label="Your Item" placeholder = "Add a Item" variant="outlined" /><br/><br/>
            <Button
        variant="contained"
        color="primary"
        size="small"
        className={classes.button}
        startIcon={<SaveIcon />}
      >
        Save
      </Button>

            </div>
        </>
    );
}

export default ToDoList;
